class Contact {    private String name;    private String lastName;    private String phoneNumber;    private String email;    Contact(String name,            String lastName,            String phoneNumber,            String email) {        this.name = name;        this.lastName = lastName;        this.phoneNumber = phoneNumber;        this.email = email;    }    public String getName() {        return name;    }    public String getLastName() {        return lastName;    }    public String getPhoneNumber() {        return phoneNumber;    }    public String getEmail() {        return email;    }}